import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import './App.css';
import PopisBodova from './PopisBodova'; // Pretpostavljamo da je ovo putanja do vaše komponente PopisBodova

function App() {
  return (
    <Router>
      <div className="App">
        <header className="App-header">
          <h1>Aplikacija za lov</h1>
          <div className="Menu">
            {/* Ostali gumbi - implementirajte slično kao ispod */}
            <Link to="/bodovi" className="Button">BODOVI</Link>
          </div>
        </header>
        {/* Ovdje se postavljaju rute */}
        <Routes>
          <Route path="/bodovi" element={<PopisBodova />} />
          {/* Definirajte dodatne rute za ostale gumbi */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
